import React from 'react';

import 'book-list-item.css';

const BookListItem = ({book}) => {
  const {title, author } = book;
  return (
    <div>
      <p>Title: {title}</p>
      <p>Author: {author}</p>
    </div>
  )
}

export default BookListItem;
